Fırında kabak mücver🥒🍃♨️🌟😋
.
Kabak ile yapılabilecek sağlıklı, lezzetli ve kolay fırın yemeğinin #tarif i👇
25*40 cm lik fırın tepsisinde 
Malzemeler:
🥒1 kg sakız kabağı
🥕1 havuç
🌿Yarım demet dereotu
🌿Yarım demet fesleğen
🌿Yarım demet maydanoz
🌿8-9 sap taze soğan
🌿4 yumurta
🌿100 gr beyaz peynir, ufalanmış
🌿2 yemek kaşığı tam buğday unu
🌿1 er çay kaşığı karabiber, pul biber, tuz
🌿Yarım çay bardağı zeytinyağı
Üzerine:
🌱1 paket rendelenmiş mozarella peyniri, 150 gr
🌱2-3 yemek kaşığı çam fıstığı
Yapılışı:
*Kabakları ve havucu yıkayıp kuruladıktan sonra rendeleyin (kabağın bir tanesini kenarları için ayırın). 
*Yeşillikleri de yıkayıp kurutarak incecik doğrayın.
*Tüm malzemeleri geniş bir kap içinde karıştırıp fırın kağıdı serilmiş tepsiye alarak üzerini düzeltin. Ayırdığınız kabağı dilimleyip yarım ay gibi ikiye bölerek kenarlara yerleştirin.
*Üzerine rendelenmiş mozarella ve çam fıstıklarını serperek 10 dakika önceden 180 derecede ısıtılmış fırında üzerleri kızarana kadar 30-35 dakika pişirin.
Afiyetle sevgiyle kalın🤗🧡💚
