CCS";}i:197;a:1:{s:12:"created_time";i:1599249665;}i:198;a:1:{s:7:"caption";s:1974:"Burgers are a Labor Day Weekend tradition, but not everyone wants meat. To the rescue: our Perfect Veggie Burger recipe! These tasty patties feature a delicious blend of veggies and seasonings to create a hearty, meaty flavor. Plus, they are incredibly easy to make. Serve them for Labor Day alongside some grilled veggie skewers for an instant hit! Here’s the recipe:⁣
⁣
Ingredients:⁣
⁣
1 cup chopped yellow onion⁣
⁣
1/2 cup chopped celery⁣
⁣
1/4 cup grapeseed oil⁣
⁣
1 teaspoon sea salt⁣
⁣
1/2 teaspoon freshly ground black pepper⁣
⁣
6 slices sprouted wheat bread or gluten-free bread, toasted⁣
⁣
8 ounces cremini or baby bella mushrooms⁣
⁣
1/2 loosely packed fresh flat-leaf parsley⁣
⁣
1 1/2 teaspoon tapioca starch⁣
⁣
1 tablespoon tamari⁣
⁣
Directions:⁣
⁣
In the bowl of a food processor, combine the onion and celery and pulse until finely chopped.⁣
⁣
Heat 2 tablespoons of the oil in a nonstick skillet set over medium heat. Add the onion mixture, salt, and pepper and cook, stirring, until golden brown, about 7 minutes. Transfer to a medium bowl and set aside.⁣
⁣
Tear the bread into 2-inch pieces, put them in the food processor, and pulse until most of the mixture is in fine crumbs. Transfer to the bowl of onion mixture.⁣
⁣
Put the mushrooms and parsley in the food processor (no need to wipe it out) and pulse until finely chopped. Add the mushroom mixture to the onion mixture.⁣
⁣
In a small bowl, combine the tapioca starch and tamari. Sprinkle it over the onion mixture. Using your hands, work the onion mixture until it begins to stick together and is almost pasty. Let stand for 10 minutes before forming into 4 patties about 4 inches across.⁣
⁣
Heat the remaining 2 tablespoons oil in a large nonstick skillet set over medium-low heat. Cook the patties until golden brown, about 4 minutes. Flip the patties and cook until the second side is golden brown, 3 to 4 minutes. Serve hot.";}i:199;a:1:{s:14:"comments_count";i:1;}i:200;a:1:{s:11:"likes_count";i:9;}i:201;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEui5pEhCCS";}i:202;a:1:{s:5:"image";s:248:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118818558_165038975174525_1778123031117173790_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=EJu94B1fy-oAX8Nn4Hv&_nc_tp=18&oh=0ec3c6c673e182dc2edcf3bfd4ad5a61&oe=5F7CA172";}i:203;a:1:{s:4:"type";s:5:"image";}i:204;a:1:{s:8:"owner_id";i:418093713;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2391001615395971867";}i:209;a:1:{s:10:"short_code";s:11:"CEui00XD-Mb";}i:210;a:1:{s:12:"created_time";i:1599249627;}i:211;a:1:{s:7:"caption";s:533:"Call tel: 516-221-8022 to place your order for delivery or for pickup. We also offer curbside pickup for your convenience. Our full bar menu is also available for takeout! 🍸⠀
