12:"created_time";i:1599249371;}i:237;a:1:{s:7:"caption";s:1090:"Sushi Noz Takeout at Home. King Crab Futomaki ♥️
——
Norwegian King Crab is an impressive sight. It is characterized by spiny shells and long, spidery legs. Most crabs have 10 appendages, but king crabs have six walking legs, one large “killer” claw and one small “feeder” claw. Swipe ⬅️. The best meat is the MERUS, which comes from the upper section of the walking leg. 🦀
——
It is impeccably poached to almost cotton-candy consistency. Its meat is delicate, rich, sweet and moist. The pleasurably salty, punched-up sauce makes a gutsy accompaniment. Citrus and mint flavors from shiso and mustard punch from wasabi complement the salty taste of anchovy. Truly an outstanding futomaki. 💯🔥🙃
